import string
import unittest

import sys
from hamcrest import assert_that, is_


def compute(data):
    return len(full_react(data))


def full_react(reaction):
    index = 0
    while index < len(reaction) - 1:
        if reacts(*reaction[index:index + 2]):
            reaction = reaction[:index] + reaction[index + 2:]
            if index > 0:
                index -= 1
        else:
            index += 1
    return reaction


def compute2(data):
    return min(len(full_react(filter_data(unit, data))) for unit in string.ascii_lowercase)


def filter_data(unit, data):
    return "".join(filter(lambda e: e.lower() != unit, data))

def reacts(unit_a, unit_b):
    return unit_a != unit_b and unit_a.upper() == unit_b.upper()


class ReactTest(unittest.TestCase):
    def test_reaction(self):
        assert_that(reacts("a", "a"), is_(False))
        assert_that(reacts("a", "A"), is_(True))
        assert_that(reacts("A", "a"), is_(True))
        assert_that(reacts("A", "A"), is_(False))
        assert_that(reacts("a", "B"), is_(False))
        assert_that(reacts("A", "B"), is_(False))


class FilterTest(unittest.TestCase):
    def test_filter(self):
        assert_that(filter_data("a", "dabAcCaCBAcCcaDA"), is_("dbcCCBcCcD"))
        assert_that(filter_data("b", "dabAcCaCBAcCcaDA"), is_("daAcCaCAcCcaDA"))
        assert_that(filter_data("c", "dabAcCaCBAcCcaDA"), is_("dabAaBAaDA"))
        assert_that(filter_data("d", "dabAcCaCBAcCcaDA"), is_("abAcCaCBAcCcaA"))


class DayTest(unittest.TestCase):
    def test_provided(self):
        input = "dabAcCaCBAcCcaDA"

        assert_that(compute(input), is_(10))

    def test_provided2(self):
        input = "dabAcCaCBAcCcaDA"

        assert_that(compute2(input), is_(4))


puzzle_input = ""

if __name__ == '__main__':
    if sys.argv[1] == "2":
        result = compute2(puzzle_input)
    else:
        result = compute(puzzle_input)

    print(f"Result is {result}")
